result:
.edit {
  padding: 5px;

  .info-row {
    margin-bottom: 20px;
    display: flex;
    align-items: center;
    justify-content: space-between;

    .info-cols {
      display: flex;
      align-items: center;
    }

    .title {
      color: #333333;
      font-weight: 500;
      font-size: 14px;
      width: 80px;
    }

    .category-col {
      display: flex;
      align-items: center;
      margin-right: 20px;
    }

    .name-col {
      display: flex;
      align-items: center;
      width: 400px;
    }

    .url-col {
      display: flex;
      align-items: center;
    }
  }

  .request {
    height: 210px;

    .request-param {
      height: 140px;
      transform: translateY(-10px);

      .kv-row {
        margin-top: 10px;

        .kv-checkbox {
          width: 20px;
          margin-right: 10px;
        }

        .kv-delete {
          width: 60px;
          margin-right: 10px;
        }

        .kv-select {
          width: 500px;
        }
      }
    }

    .request-body {
      width: 100%;
      height: 100%;
    }

  }
  .response {
    height: 360px;
    background-color: #FFFFFF;
    border: 1px solid #dfe2e8;
    box-shadow: 1px 3px 5px #DCDFE6;

    .response-header {
      background-color: #F6F7FA;
      height: 40px;
      display: flex;
      justify-content:space-between;
      align-items: center;
      border-bottom: 1px solid #dfe2e8;

      .response-title {
        font-size: 15px;
        color: #909399;
        margin-left: 10px;
      }

      .response-info-list {
        display: flex;
        align-items: center;

        .response-info-title {
          font-size: 12px;
          color: #909399;
          margin-right: 10px;
        }

        .success {
          display: flex;
          font-size: 12px;
          margin-right: 10px;
          color: #0ec23b;
        }

        .warning {
          display: flex;
          font-size: 12px;
          margin-right: 10px;
          color: #E6A23C;
        }

        .error {
          display: flex;
          font-size: 12px;
          margin-right: 10px;
          color: #c20215;
        }
      }
    }

    .response-default-body {
      height: 100%;
      display: flex;
      flex-direction: column;
      justify-content: center;
      align-items: center;

      .default-content {
        color: #909399;
        margin-top: 10px;
      }
    }

    .response-body {
      height: calc(100% - 40px);
      position: relative;

      .response-body-path {
        position: absolute;
        width: auto;
        top: 10px;
        right: 20px;
        color: #909399;
        z-index: 999;
      }

      .body-text-is-json {
        word-wrap: break-word;
        margin: 10px 15px 10px 10px;
      }

      .body-text-not-json {
        word-wrap: break-word;
        margin: 10px 15px 10px 10px;
        color: #909399;
      }
    }
  }
}
